const routes = [
    {path:'/admin',exact:true,name:'Admin'},
    {path:'/admin/dashboard',exact:true,name:'Dashboard',component: Dashboard},
    {path:'/admin/profile',exact:true,name:'AdminAccount',component: AdminAccount},    
];

export default routes;
